import React from 'react'
import MovieList from './../Movies'

export default function Movies(){
    return(
        <div className='mx-auto flex justify-center py-20'>
        {
            MovieList.map((dataList) => {
               return(
                   <div className='inline-block text-center mx-5'>
                       <img 
                            src={dataList.img}
                            className='w-60 h-80'
                            alt=''
                        />
                        <h1 className='text-black z-50 relative top-0'>{dataList.title}</h1>
                   </div>

               )
           })
        }
        </div>
    )
}
